import {TextField } from "@material-ui/core";
// import { Form } from "react-bootstrap";
// import { Button, FormControl } from "@mui/material";
// import Button from "@material-ui/core/Button";
// import { TextField } from "material-ui";

function SignUpForm({setUsername, setEmail, setPassword, setPasswordConfirmation}) {

  const name = "name"
  const name3 = name[0].toUpperCase() + name.slice(1, name.length)


 console.log(name3)
  // console.log(name2)
  // console.log(name3)
  // console.log(name1.slice(1, name1.length))
  const userField = (label, name) =>{
    // const name3 = name[0].toUpperCase() + name.slice(1, name.length)
    <TextField 
    required
    variant="outlined"
    label="Username"
    name='username'
    onChange={
      e=>{ const {name, value} = e.target
      setUsername({[name]: value})}}
  ></TextField>
  }

  return (
    <>
      <TextField 
        required
        variant="outlined"
        // id="outline-required"
        label="UserName"
        name='username'
        onChange={
          e=>{ const {name, value} = e.target
          setUsername({[name]: value})}}
      ></TextField>

      <TextField 
        required
        variant="outlined"
        // id="outline-required"
        label="Email"
        name='email'
        onChange={e=>setEmail({name:e.target.name, value: e.target.value})}
      ></TextField>

      <TextField 
        required
        variant="outlined"
        // id="outline-required"
        label="Password"
        name="password"
        type="password"
        onChange={e=>setPassword({name:e.target.name, value: e.target.value})}
      ></TextField>

      <TextField 
        required
        variant="outlined"
        // id="outline-required"
        label="Password Confirmation"
        name="password_confirmation"
        type="password"
        onChange={e=>setPasswordConfirmation({name:e.target.name, value: e.target.value})}
      ></TextField>
    </>
  );
}
export default SignUpForm;
